import Button from "@mui/material/Button";
import Dialog from "@mui/material/Dialog";
import "../Dashboard.css";
import Student from "../images/Student.png";
import PaymentPage from "../Pages/PaymentsPage.js";
import { useNavigate } from "react-router-dom";
import React, { useState } from "react";

const Internal = ({ open, handleClose, onSubmit, openSignup }) => {
  const [user, setUser] = React.useState("");
  const [password, setPassword] = React.useState("");

  const handleData = (isSubmit) => {
    setUser("");
    setPassword("");

    if (isSubmit) {
      if (user === "" || password === "") {
        console.log("Please Enter User Name and Password");
      } else {
        onSubmit(user, password);
      }
    } else {
      handleClose();
    }
  };

  return (
    <div>
      <Dialog
        classes={{ paper: "submit-form" }}
        open={open}
        onClose={handleClose}
      >
        <img className="dialog-title" src={Student} alt="firespot" />
        <div className="title-heading">
          <div className="sign-in">Sign In</div>
          <div className="uom-user">UOM User</div>
        </div>
        <div>
          <hr />
        </div>

        <div className="form-row">User Name</div>

        <input className="select-button-1" type="text" />

        <div className="payment-description-main">
          <div className="form-row">Password</div>

          <input className="select-button-2" type="password" />
        </div>
        <div className="remember-me">
          <span>
            <input type="checkbox" />
            Remember Me
          </span>
          <div className="remember-me">
            <a
              className="forgot"
              href={PaymentPage}
              target="_blank  "
              rel="noreferrer noopener"
              style={{ textDecoration: "none" }}
            >
              Forgot Password
            </a>
          </div>
        </div>

        <div className="signin-text">
          <Button className="signin" onClick={() => handleData(true)}>
            Sign in
          </Button>
        </div>
        <div className="hr-main">
          <hr className="hr" />
          or
          <hr className="hr" />
        </div>
        <div className="dont-have">
          <div>Don't have an Account ?</div>
          <div>
            <button className="create-new-one" onClick={openSignup}>
              <u>Create New One</u>
            </button>
          </div>
        </div>
      </Dialog>
    </div>
  );
};
export default Internal;
